          <Nav className="mr-auto">
            <Nav.Link href="/cart">
              <i className="fas fa-shopping-cart" /> {""}Cart
            </Nav.Link>
            <Nav.Link href="/login">
              {" "}
              <i className="fas fa-user" /> {""}Login
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    </header>
  );
};

export default Header;
